sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid"]);
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gc_pubsub_spoke.fetch_snapshots', {
        "project_id": inputs.projectid
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var snapshots = [];
    obj.forEach(function(snapshot) {
        snapshots.push({
            "name": snapshot.name,
            "label": snapshot.name
        });
    })
    outputs.snapshots = {
        "data": snapshots
    }
    outputs.snapshot_list = snapshots;
})(inputs, outputs);

